pragma solidity 0.4.24;
pragma experimental ABIEncoderV2;


//Remix imports
//import "https://github.com/smartcontractkit/chainlink/evm/contracts/ChainlinkClient.sol";
//import "https://github.com/smartcontractkit/chainlink/evm/contracts/vendor/Ownable.sol";
//import "https://github.com/smartcontractkit/LinkToken/contracts/LinkToken.sol";


//Truffle Imports
import "chainlink/contracts/ChainlinkClient.sol";
import "chainlink/contracts/vendor/Ownable.sol";
import "chainlink/contracts/interfaces/LinkTokenInterface.sol";


contract InsuranceProvider {

    using SafeMath_Chainlink for uint;
    address public insurer = msg.sender;
    address [] contracts;
    address public linkTokenRopsten = 0x20fE562d797A42Dcb3399062AE9546cd06f63280; //address of LINK token on Ropsten

     constructor()   public payable {

         //need payable contractor to initiate funds to be used for contracts
     }


    modifier onlyOwner() {
		require(insurer == msg.sender,'Only Insurance provider can do this');
        _;
    }

    event contractCreated(address _insurer, uint _premium, uint _totalCover);

    //create a new contract for client, automatically approved and deployed 
    function newContract(address _client, uint _duration, uint _premium, uint _totalCover, uint _cropLocation) public payable returns(address) {

        //to do extra validation to ensure preimium paid matches with total _totalCover
        require (msg.value > _totalCover.div(100),'Incorrect premium paid');

        //create contract, send payout amount plus some extra ether so contract has enough gas to do payout tranasctions 
        Insurance i = (new Insurance).value(_totalCover.add(1000000000000000))(_client, _duration, _premium, _totalCover, _cropLocation);

        contracts.push(address(i));  //to delete run delete contracts[index]

        emit contractCreated(address(i), msg.value, _totalCover);

        //now that contract has been created, we need to fund it with enough LINK tokens to fulfil 1 Oracle request per day/60 seconds.
        LinkTokenInterface link = LinkTokenInterface(i.getChainlinkToken());
        link.transfer(address(i), (_duration.div(60)) * 1 ether);

        return address(i);

    }

    function getContracts() public view returns (address [] memory) {
        return contracts;
    }

    function getContractStatus(address _address) external view returns (bool) {
        Insurance i = Insurance(_address);
        return i.getContractStatus();
    }

    //function to end provider contract, in case of bugs or needing to update logic etc, funds are returned to insurance provider
    function endContractProvider() external payable onlyOwner() {
        selfdestruct(insurer);
    }

    function getContractBalance() external view returns (uint) {
        return address(this).balance;
    }

    //helper function to recover LINK funds if needed
    function withdrawLink() public onlyOwner {
        LinkTokenInterface link = LinkTokenInterface(linkTokenRopsten);
        require(link.transfer(msg.sender, link.balanceOf(address(this))), "Unable to transfer");
    }

    function getInsurer() external view returns (address) {
        return insurer;
    }

    //fallback function, to receive ether
    function() external payable {  }


}

contract Insurance is ChainlinkClient, Ownable  {

    using SafeMath_Chainlink for uint;

    uint public constant DROUGHT_TEMP_THRESDHOLD = 3700;  //37 (3700) degrees celcius is threshold for drought in Australia
    uint public constant DROUGHT_DAYS_THRESDHOLD = 3;  //3 days above the temp is the trigger for contract conditions to be reached
    uint256 constant private ORACLE_PAYMENT = 1 * LINK;
    string constant OPEN_WEATHER_URL = "https://openweathermap.org/data/2.5/weather?";
    string constant OPEN_WEATHER_KEY = "b6907d289e10d714a6e88b30761fae22";


    address public insurer;
    address  client;
    uint contractStartDate;

    uint startDate;
    uint duration;
    uint premium;
    uint totalCover;
    uint daysOverMaxTemp;
    bool contractActive;
    uint currentTemp = 0;
    uint currentTempDateChecked = now;
    uint cropLocation;


    modifier onlyOwner() {
		require(insurer == msg.sender,'Only Insurance provider can do this');
        _;
    }

    modifier onContractEnded() {
        if (contractStartDate + duration < now) {
          _;  
        } 
    }

    modifier onContractActive() {
        require(contractActive == true ,'Contract has ended, cant interact with it anymore');
        _;
    }

    modifier callFrequencyOncePerDay() {
        require(now - currentTempDateChecked > 60,'Can only check temeprature once per day');
        _;
    }

    event contractCreated(address _insurer, address _client, uint _duration, uint _premium, uint _totalCover);
    event contractPaidOut(uint _paidTime, uint _totalPaid, uint _finalTemp);
    event contractEnded(uint _endTime, uint _totalReturned);
    event tempThresholdReached(uint _temp);
    event dataRequestSent(address _oracle,string _jobId);
    event dataReceived(uint _temp);


    //constructor, creates the new Insurance contract
    constructor(address _client, uint _duration, uint _premium, uint _totalCover, uint _cropLocation)  payable Ownable() public {
        //set chainlink token to public testnet one
        setPublicChainlinkToken();

        //first ensure insurer has fully funded the contract
        require(msg.value > _totalCover, "Not enough or too many funds send to contract");

        //now initialize values for the contract
        insurer= msg.sender;
        client = _client;
        startDate = now;
        duration = _duration;
        premium = _premium;
        totalCover = _totalCover;
        daysOverMaxTemp = 0;
        contractActive = true;
        cropLocation = _cropLocation;
        contractStartDate = now;

        emit contractCreated(insurer,
                             client,
                             duration,
                             premium,
                             totalCover);
    }

    //update contract status, check conditions
    function checkContract(address _oracle, string memory  _jobId) public payable onContractActive()  {
        //first call end contract in case of insurance contract duration expiring, if it hasn't won't do anything
        endContract();

        //contract may have been marked inactive above, only do request if needed
        if (contractActive) {

            //grab updated weather info via Oracle request, should update currentTemp
            // newRequest takes a JobID, a callback address, and callback function as input
            Chainlink.Request memory req = buildChainlinkRequest(stringToBytes32(_jobId), address(this), this.checkContractCallBack.selector);


            // Adds an integer with the key "city" to the request parameters, to be used by the Oracle node as a parameter when making a REST request
            string memory url = string(abi.encodePacked(OPEN_WEATHER_URL, "id=",uint2str(cropLocation),"&appid=",OPEN_WEATHER_KEY));
            req.add("get", url); //sends the GET request to the oracle
            req.add("path", "main.temp");  //sends the path to be traversed when the GET returns data
            req.addInt("times", 100);     //tells the Oracle to * the result by 100 

            sendChainlinkRequestTo(_oracle, req, ORACLE_PAYMENT);  //sends the request to the Oracle Contract which will emit an event that the Oracle Node will pick up and action

            emit dataRequestSent(_oracle,_jobId);
        }
    }



    //Callback function - This gets called by the Oracle Contract when the Oracle Node passes data back to the Oracle Contract
    //The function will take the temperature from the GET request and update the Smart Contract
    function checkContractCallBack(bytes32 _requestId, uint256 _temp) public payable recordChainlinkFulfillment(_requestId) onContractActive() callFrequencyOncePerDay()  {
        //set current temperature to value returned from Oracle, and store date this was retrieved (to avoid spam and gaming the contract)
        currentTemp = _temp;
        currentTempDateChecked = now;
        emit dataReceived(_temp);

        //check if payout conditions have been met, if so call payoutcontract, which should also end/kill contract at the end
        if (currentTemp > DROUGHT_TEMP_THRESDHOLD ) { //temp threshold has been  met, add a day of over threshold
            daysOverMaxTemp += 1;
            emit tempThresholdReached(currentTemp);
        } else {
            //current temeprature isn't > drought threshold, reset number of days over max temp param (in case it was >0)
            daysOverMaxTemp = 0;
        }

        if (daysOverMaxTemp >= DROUGHT_DAYS_THRESDHOLD) {  // day threshold has been met
            //need to pay client out insurance amount
            payOutContract();
        }
    }


    //perform payout - insurance conditions have been met, do payout
    function payOutContract() private onContractActive()  {

        //Transfer agreed amount to client
        client.transfer(totalCover);

        emit contractPaidOut(now, totalCover, currentTemp);

        //now that amount has been transferred, can end the contract 
        //mark contract as ended, so no future calls can be done
        contractActive = false;

    }  

    //end contract - insurance conditions have not been met, and contract expired, end contract and return funds
    function endContract() private onContractEnded()   {
        //mark contract as ended, so no future calls can be done
        contractActive = false;

        //return funds back to insurance provider then end/kill the contract
        insurer.transfer(address(this).balance);

        emit contractEnded(now, address(this).balance);
    }  

    //debug functions---------------------------------------
    function getContractBalance() external view returns (uint) {
        return address(this).balance;
    } 

    function getContractStatus() external view returns (bool) {
        return contractActive;
    }

    function getCurrentTemp() external view returns (uint) {
        return currentTemp;
    }

    function getDaysOverMaxTemp() external view returns (uint) {
        return daysOverMaxTemp;
    }

    function getCurrentTempDateChecked() external view returns (uint) {
        return currentTempDateChecked;
    }

    function getDuration() external view returns (uint) {
        return duration;
    }

    function getContractStartDate() external view returns (uint) {
        return startDate;
    }


    function getNow() external view returns (uint) {
        return now;
    }


    //debug functions---------------------------------------


    function getChainlinkToken() public view returns (address) {
        return chainlinkTokenAddress();
    }

    function withdrawLink() public onlyOwner {
        LinkTokenInterface link = LinkTokenInterface(chainlinkTokenAddress());
        require(link.transfer(msg.sender, link.balanceOf(address(this))), "Unable to transfer");
    }

    function stringToBytes32(string memory source) private pure returns (bytes32 result) {
        bytes memory tempEmptyStringTest = bytes(source);
        if (tempEmptyStringTest.length == 0) {
         return 0x0;
        }

        assembly { // solhint-disable-line no-inline-assembly
        result := mload(add(source, 32))
        }
    }



    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len - 1;
        while (_i != 0) {
            bstr[k--] = byte(uint8(48 + _i % 10));
            _i /= 10;
        }
        return string(bstr);
    }

    //fallback function so contrat can receive ether when required
    function() external payable {  }


}
